import React from 'react';



function DisplaySimpson ({ simpson }) {
  return (
    <div className="DisplaySimpson">
      <img
        src={simpson.image}
        alt={simpson.character}
      />
      <ul>
        <li>Gender: {quote.character}</li>
        <li>
          Name: {simpson.name.title}{' '}
          {simpson.name.last}{' '}
          {simpson.name.first}
        </li>
        <li>E-mail: {simpson.email}</li>
        <li>
          Location: {simpson.location.street.number}{' '}
          {simpson.location.street.name},{' '}
          {simpson.location.postcode} {simpson.location.city}
        </li>
      </ul>
    </div>
  );
};

export default DisplaySimpson;
